import React from 'react';
import './trablatransacciones.css';

function TablaTransacciones(){

	var myHeaders = [ "GRUPO", "TXN", "DESCRIPCION" ];
	var tablatransacciones = new AW.Grid.Extended;
	tablatransacciones.setId("tablatransacciones");
	tablatransacciones.setHeaderText(myHeaders);
	//tablatransacciones.setCellData(myCells);
	tablatransacciones.setColumnCount(3);
	tablatransacciones.setRowHeight(35);
	tablatransacciones.setRowCount(20);
	tablatransacciones.setSelectionMode("single-row"); // set selection mode to single row
	tablatransacciones.getRowTemplate().setClass("text", "wrap");   // /** Text Wrap **/
    tablatransacciones.setCellTemplate(new AW.Templates.ImageText); //  /** Text Wrap **/
    tablatransacciones.refresh();

    /*tablatransacciones.onSelectedRowsChanged = function(rowIndicesArray){
    	selected_TXN = myCells[rowIndicesArray][1];
    }*/

	return(
		<div className="divtablatransacciones">
			<div className="formbusqueda">
				<h2 className="tituloBusqueda">Busqueda en la Tabla</h2>
				<div className="divforminput">
					<label htmlFor="inputGrupo">Grupo:</label>
					<input type="text" name="inputGrupo" id="inputGrupo"/>
				</div>
				<div className="divforminput">
					<label htmlFor="inputGrupo">Grupo:</label>
					<input type="text" name="inputGrupo" id="inputGrupo"/>
				</div>
				<div className="divforminput">
					<label htmlFor="inputGrupo">Grupo:</label>
					<input type="text" name="inputGrupo" id="inputGrupo"/>
				</div>
				<button className="btnBuscarTabla" id="btnBuscarTabla">
					<svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="#FFFFFF" class="bi bi-search" viewBox="0 0 16 16">
						<path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001q.044.06.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1 1 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0"/>
					</svg>
					&nbsp;
					Buscar
				</button>
			</div>
			<div className="tablatransacciones" id="tablatransacciones"></div>
		</div>
		);
}

export {TablaTransacciones};
